import React from 'react';
import './footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer_container container">
        <h1 className="footer_title">Nitin Ahirwal</h1>
      </div>
    </footer>
  );
};

export default Footer;
